( -- Start Rule Based Restrictions
( --- GRP_ID: 1
( --- GRP_ID: 1 and SUB_GRP_ID: 1
( --- Start of INCLUDE
( A.FCT_GRP_IND = 'CoreCurrent' 
or A.FCT_GRP_IND = 'CoreMarketShare') 
) --- End of INCLUDE
) -- End of SUB_GRP_ID 1
) -- End of GRP_ID 1
) -- End Rule Based Restrictions
) );
